webpackJsonp([0xc0234f596a63],{791:function(a,n){a.exports={data:{markdownRemark:{frontmatter:{title:"MAL'CHIK-BATISKAF",type:"lyrics"},html:"<h1>MAL'CHIK&#8208;BATISKAF</h1>\n<section>\n<p>Ja nauchilsja slyshat', kak vo mne<br>\nzhurchit voda, kak v jetoj glubine<br>\nvsjo more zhidkim solncem obyskav,<br>\nko mne vernulsja mal'chik‐batiskaf.<br>\nOn govoril so mnoj na jazyke<br>\nkorallov — on opravdyvalsja mne!<br>\nV slezah ego ja kameshki iskal,<br>\nkotorye on vykoval iz skal.</p>\n<p>Ja golovu pojmal setjami ruk — <br>\npryzhkami ryba risovala krug<br>\ni nespokojno hljupala gubami — <br>\nrvalas' naruzhu. Prevratilas' v kamen',<br>\nkogda uznala, chto iskomyj klad<br>\nzadavlen ne podoshvoj dna, a nad<br>\nvodoj letaet slabym al'batrosom,<br>\nglotajushhim vody tugie trosy<br>\ni ryb krylatyh lovjashhim meshkom.<br>\nMoj mal'chik, nauchis' hodit' peshkom.</p>\n<p>Teper' ja chasto slyshu, kak vo mne<br>\nrebjonok begaet za pticej po vode.</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/malchikBatiskaf/"}}}});
